void selection_sort(int arr[],int size){
	int pass = size-1;
	int max;
	int m;
	clock_t start = clock();
	for(int i = 1;i<pass;i++){
		m = size-i;
		max = arr[size-i];
		for(int j = 0;j<=size-i;j++){
			if(arr[j]>max){
				max=arr[j];
				m = j;
			}
		}
		int temp = arr[size-i];
		arr[size-i]=max;
		arr[m] = temp;
	}
	clock_t end = clock();
	double time = double(end-start)/CLOCKS_PER_SEC;
	cout<<"Time consumed = "<<time<<" sec"<<endl;
	cout<<"Array Sorted!"<<endl;
	for(int k = 0;k<size;k++){
		cout<<arr[k]<<",";
	}
	cout<<endl;
}
